    [],nt"num_tags": 4,nt"name": "becharof-national-wildlife-refuge-annual-narrative-report-calendar-year-1979",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Becharof
    NWR outlines Refuge accomplishments during the 1979 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Refuge administration
    is outlined; information about personnel and funding is given. Habitat management
    is also covered; subjects include wilderness areas. The wildlife section of the
    report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, marine mammals, and
    fisheries resources. The public uses of the Refuge described in this report include
    hunting.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
